import React, { Fragment } from 'react';
import './App.css';

function App() {
  return (
    <Fragment>
      <div className='heading'>
        <div className='hexagon'>
          <img src='https://i.imgur.com/HCaTey5.png' />
          <p className='abv-iiitm'>ABV-IIITM</p>
          <p className='presents'>presents</p>
          <p>HACK STACK</p>
        </div>
      </div>
    </Fragment>
  );
}

export default App;
